@Kaustubh (KD) this is also related to https://instabase.atlassian.net/browse/EPD-3034

the issue is that for table extraction fields, we try to ensure that the output is a table, regardless of the prompts in the cleaning lines

similarly for derived fields - since we currently don't have a way to specify "result type" for derived fields, we assume we want to maintain the same type as the input field -> so if the input field is a table, we return an error if the derived field prompt returns a non-table
